  return (
    <div>
      <div>
        <p>March 28th 2021</p>
      </div>
      <div>
        <h2>College Tuition</h2>
        <div>
          <p>$250.23</p>
        </div>
      </div>
    </div>
  );
}

export default ExpenseItem;
